import logo from ".././bg-mobile-dark.jpg";
function CountryCards() {
  return (
    <>
      <div className="card-container">
        <div>
          <img alt="flag" src={logo} />
        </div>
        <div>
          <h2>Germany</h2>
                  <p>Population: { }</p>
          <p>Region</p>
          <p>Europe</p>
        </div>
      </div>
    </>
  );
}
export default CountryCards;
